 @maiortorcidadomundo6334  Cagada é o que o Flamengo vem fazendo nls ultimos jogos entregando tudo no segundo tempo

Parece q so sabe fazer numeros ilusorios para nao demitir o treinador.
A verdade é que se pegar um adversário forte vai tomar goleada, igual contra o Sao Paulo e o Atlético MG ano passado

 @papadordebotafoguense5571  O problema é que o Fluminense so ganha quando não vale nada

A unica coisa q valeu foi passr na tabela e tirar um crise eminente no teu time

Mas isso o Flamengo faz de melhor tirar os rivais da crise...

 @PedroHenrique-kk2ic  Nao entendi pq nao tirou ele. Ate o Michael tava melhor. E foi la e botou um tal de Max kkkkk

Ue cade o tal do Richard, Piris da Motta, Lazaro, Bala?

Tabto fizeram propaganda desses maluco, Lazaro ja foi ate convocado e me trazem um tal de Max kkkk

 @maiortorcidadomundo6334  Claro q existe. Se vc nao sabe todo o Campeonato Mundial tem um Time que representa o país sede, independente se esse país sede ja tem outro time classificado ao mundial por outra vaga disputada.

Quando foi no Catar, o Time do Catar jogou o mundial, mesmo nao sendo Campeao da Champions Árabe.
Todos os Mundiais sao Assim. Inclusive o de 2000 que o país sede foi o Brasil e o Corinthians jogou sem ter ganhado libertadores.

