@Edson de oliveira santos Oliveira Santos Se for olhar o jogo em chance os 2 tiveram varias chance de marcar e ganhar
O jogo podia ser 4x0 Flamengo 3x0 Fluminense. 3x3, 3x2, 4x2 2x2 2x1

Mas foi 1x0 Fluminense. É isto!

 @Thfc10  Nao acho q o Fluminense jogou muito melhor.
Pra mim o Flamengo deixou de jogar, e o Fluminense agiu rapido antes do final do jogo

No final o que vale é quem aproveitou o tempo que teve dominando o jogo e fez o Gol.

 @yusukeurameshi1457  Para mim o Campeonato so se define a partir da 15 rodada
Ate la tudo pode acontecerpouco faz diferença no final da temporada

Ate o Gremio ainda poderia ser campeão.

