A questão da CBF eu discordo, se você não acompanha amigão, o Flamengo bateu de frente com eles por questão de alguns jogadores. Falem o que quiser, tudo que vocês mais falam que o flamengo é e isso ou aquilo é devido ao grande dinheiro que ele gera com a torcida. Enfim, vou falar mais nada não quiser fala ai 🤣😅

 @GabrielGoncalves-es5ck   continua sem estádio sim.
;-; Mundial do Sport? Ah, a não ser pelo app "air campeonato", o jogo tem Br, copa do Brasil, libertadores, sul americana, Recopa, Supercopa, Mundial. Como é um jogo que vc só controla o botão (o jogo é futebol de botão) aí sim qualquer time ganha Mundial kkkkkkk;

Mas varmengo, florminenC, Ceará, fortaleza, Paysandu continuam sem estádio 👍🏻

